import { Link } from "react-router-dom/cjs/react-router-dom.min";
const Navbar = () => {
    return(
        <div className="navbar">
            <h2>Контакты</h2>
            <div>
                <Link path='/'>
                    <h2>Добавить Контакты</h2>
                </Link>
                <h2>Список Контактов</h2>
            </div>
        </div>
    )
}
export default Navbar;
